import React from "react";
import '../src/index.css';
import Common from "./Common";
import Services from "./Services";
import Contact from "./Contact";

const Home=()=>{
    return (
        <>
          <div >

          </div>
          <Common name="Grow your buisness with" visit="/services" btnName="Get Started"/>
          
          <section>
            <Services></Services>
          </section>
          <section>
              <Contact></Contact>
          </section>
           
        </>
    );
}

export default Home;
